import React from 'react';
import { Link } from 'react-router-dom';
import * as S from './styles';
export default function Header() {
  return (
    <>
      <S.Navigation>
        <S.ContainerLink>
          <S.List>
            <Link to="/">
              <p>Home</p>
            </Link>
          </S.List>
          <S.List>
            <Link to="/about">About</Link>
          </S.List>

          <p>About</p>
        </S.ContainerLink>
      </S.Navigation>
    </>
  );
}
